INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 24, 2, 10046, 2, 401, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 102301, "アヤネ", 24001, 0.0, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 0.0, 24, 2, 10046, 1, 402, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 102301, "アヤネ", 24002, 0.0, 2.21);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 24, 2, 10046, 2, 403, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 102301, "アヤネ", 24003, 0.0, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 0.0, 24, 1, 10046, 2, 701, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192201, "アサヒ", 24004, 0.0, 1.99);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 0.0, 24, 2, 10046, 1, 702, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192201, "アサヒ", 24005, 0.0, 2.21);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 0.0, 24, 1, 10046, 2, 703, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192201, "アサヒ", 24006, 0.0, 3.33);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 24, 2, 10046, 2, 801, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192301, "部員３", 24007, 0.0, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 0.0, 24, 2, 10046, 1, 802, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192301, "部員３", 24008, 0.0, 2.68);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 24, 2, 10046, 2, 803, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192301, "部員３", 24009, 0.0, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("やった！", 0.0, 24, 1, 10046, 1, 501, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192501, "", 24010, 0.0, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("勝ったよ！", 0.0, 24, 1, 10046, 1, 502, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192501, "", 24011, 0.0, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("いい調子！", 0.0, 24, 1, 10046, 1, 503, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192501, "", 24012, 0.0, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 0.0, 24, 2, 10046, 6, 111, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113501, "ミサト", 24013, 0.0, 5.33);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 0.0, 24, 2, 10046, 1, 112, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113501, "ミサト", 24014, 0.0, 6.85);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 0.0, 24, 2, 10046, 1, 113, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113501, "ミサト", 24015, 0.0, 3.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 0.0, 24, 2, 10046, 1, 611, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192401, "ダイチ", 24016, 0.0, 6.11);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 0.0, 24, 2, 10046, 1, 612, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192401, "ダイチ", 24017, 0.0, 6.75);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 24, 2, 10046, 2, 613, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192401, "ダイチ", 24018, 0.0, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 0.0, 24, 1, 10046, 2, 211, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113401, "ハツネ", 24019, 0.0, 4.52);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 0.0, 24, 1, 10046, 2, 212, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113401, "ハツネ", 24020, 0.0, 3.89);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 0.0, 24, 2, 10046, 1, 213, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113401, "ハツネ", 24021, 0.0, 13.49);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 0.0, 24, 2, 10046, 1, 311, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 106501, "カヤ", 24022, 0.0, 3.17);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 0.0, 24, 2, 10046, 1, 312, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 106501, "カヤ", 24023, 0.0, 4.42);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 0.0, 24, 1, 10046, 6, 313, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 106501, "カヤ", 24024, 0.0, 2.89);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 0.0, 24, 3, 10046, 4, 421, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 102301, "アヤネ", 24025, 0.0, 3.71);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 0.0, 24, 1, 10046, 2, 721, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192201, "アサヒ", 24026, 0.0, 5.1);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 0.0, 24, 3, 10046, 1, 821, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192301, "部員３", 24027, 0.0, 4.34);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("いい勝負だったよ\nまたやろうね", 0.0, 24, 1, 10046, 1, 521, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 192501, "", 24028, 0.0, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 0.0, 24, 2, 10046, 1, 101, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113501, "ミサト", 24029, -360.0, 5.62);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 0.0, 24, 2, 10046, 1, 102, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113501, "ミサト", 24030, -360.0, 9.58);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, 24, 2, 10046, 2, 103, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113501, "ミサト", 24031, -360.0, 0.0);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 0.0, 24, 1, 10046, 2, 104, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113501, "ミサト", 24032, -360.0, 9.13);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 0.0, 24, 2, 10046, 1, 105, "2030/12/17 14:59:59", "2020/07/31 12:00:00", 113501, "ミサト", 24033, -360.0, 8.27);
